"use strict";var validadorDocumentos=function(){return{validarCIF:function(e){var t=/^[A-z]([0-9]{8}|-[0-9]{8})$/i;var n;var r;var i=[];var s=[];var o=0,u=0,a=0;if(!t.test(e))return false;n=e.replace("-","").toUpperCase().substr(1,7);for(var f in n){f%2==0?s.push(n[f]):i.push(n[f])}for(var f in i){var l=i[f];if(!isNaN(l)){o+=parseInt(l)}}for(var f in s){var l=s[f];if(!isNaN(l)){var c=l*2;var h;if(c>9){h=parseInt(c.toString().substr(0,1))+parseInt(c.toString().substr(1,2))}else{h=c}u+=h}}a=o+u;a=10-parseInt(a.toString().substr(1,2));try{console.log("A",o);console.log("B",u);console.log("C",a);console.log("CIF",e)}catch(p){}if(a!=e.substr(e.length-1,e.length))return false;return true},validarNIE:function(e){var t=/^([A-z]|[A-z]-|)[0-9]{7,8}([A-z]|-[A-z])$/i;var n;var r,i,s;var o=0;var u={X:0,Y:1,Z:2};var a={0:"T",1:"R",2:"W",3:"A",4:"G",5:"M",6:"Y",7:"F",8:"P",9:"D",10:"X",11:"B",12:"N",13:"J",14:"Z",15:"S",16:"Q",17:"V",18:"H",19:"L",20:"C",21:"K",22:"E"};if(!t.test(e))return false;n=e.replace("-","").toUpperCase();r=n.substr(0,1);i=n.substr(n.length-1,n.length);if(isNaN(r)){r=u[r];n=r+n.substr(1,n.length)}o=parseInt(n)%23;try{console.log("A",a[o])}catch(f){}if(i.toUpperCase()!=a[o])return false;return true}}}()
